import React from 'react'
import ReactDOM from 'react-dom';

let time = new Date().getHours();

let Greet = " ";

if(time>=1 && time<12){
    Greet = "Good Morining";
}
else if(time>12 && time<19){
    Greet = "Good Afternoon";
}
else{
    Greet = "Good Morining";
}



ReactDOM.render(

    <>
         <h1>Hello Sir {Greet}</h1>
    </>,
    document.getElementById('root')



);
